import React from 'react'
import {  Route, Switch } from 'react-router-dom';
import Notes from './public/notes'
 const rightContainer = () => {
    return (

       <Switch>

       <Route exact path="/notes" component={Notes}/>




       </Switch>
    )
}
export default rightContainer;
